/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function(s, t) {
    var i, j=0, temp;
    var cnt = [];
    var arr1 = s.split("");
    var arr2 = t.split("");
    for(i = 0; i < arr2.length; i++)
    {
    	var ans = arr1.indexOf(arr2[i]);
    	if(ans < 0)
    	{
    		cnt[j++] = arr2[i];
    	}
    	else {
    		arr1.splice(ans,1);
    	}
    }
    return cnt.join("");
};
